    var { id } = useParams()
    const [user, setuser] = useState({})

    useEffect(() => {
        axios.get(`https://jsonplaceholder.typicode.com/users/${id}`)
            .then((res) => {
                console.log(res.data);
                setuser(res.data)
            })
    }, [])

